public BeanFilterBuilder applyAnnotations(List<Bean> annotations) {

	for (Bean b : annotations) {

		if (! b.bpi().isEmpty())
			bpi(split(b.bpi()));

		if (! b.typeName().isEmpty())
			typeName(b.typeName());

		if (b.sort())
			sortProperties(true);

		if (b.fluentSetters())
			fluentSetters(true);

		if (! b.bpx().isEmpty())
			bpx(split(b.bpx()));

		if (! b.bpro().isEmpty())
			bpro(split(b.bpro()));

		if (! b.bpwo().isEmpty())
			bpwo(split(b.bpwo()));

		if (b.propertyNamer() != PropertyNamerDefault.class)
			propertyNamer(b.propertyNamer());

		if (b.interfaceClass() != Object.class)
			interfaceClass(b.interfaceClass());

		if (b.stopClass() != Object.class)
			stopClass(b.stopClass());

		if (b.dictionary().length > 0)
			dictionary(b.dictionary());

		if (b.interceptor() != BeanInterceptor.Default.class)
			interceptor(b.interceptor());

		if (b.implClass() != Null.class)
			implClass(b.implClass());

		if (! b.example().isEmpty())
			example(b.example());
	}
	return this;
}

